import React, { useState, useCallback } from "react";

export default function UseCallbackExample() {
    const [count, setCount] = useState(0);

    // دالة عادية
    const normalFunction = () => {
        console.log("تم إنشاء الدالة العادية من جديد! القيمة الحالية: ", count + 1);
    };

    // دالة ميمورية باستخدام useCallback
    const memoizedFunction = useCallback(() => {
        console.log("تمت إعادة استخدام الدالة الميمورية! القيمة الحالية: ", count + 1);
    }, [count]);

    // تحديث العداد مع استدعاء الدالة
    const incrementWithNormalFunction = () => {
        setCount((prev) => prev + 1);
        normalFunction(); // استدعاء الدالة العادية
    };

    const incrementWithMemoizedFunction = () => {
        setCount((prev) => prev + 1);
        memoizedFunction(); // استدعاء الدالة الميمورية
    };

    return (
        <div>
            <h1>Count: {count}</h1>
            <button onClick={incrementWithNormalFunction}>زيادة العداد (عادية)</button>
            <button onClick={incrementWithMemoizedFunction}>زيادة العداد (ميمورية)</button>
        </div>
    );
}
